import Modal from '../../components/ui/Modal';
import LoginForm from './LoginForm';

function AuthForm() {
	return (
		<div className=''>
			<div className='p-3 bg-warning bg-opacity-5 border border-dark border-start border-opacity-10 rounded-end shadow col-md-9 mx-auto'>
				<div className='col-md-6 offset-md-3'>
					<div className='signup-form'>
						<h5 className='mt-3 text-center'>ACCOUNT</h5>
						<LoginForm />
						<div className='d-flex'>
							<button
								type='button'
								className='justify-center mt-3 mx-auto btn btn-outline-dark text-light col-md-5 offset-md-3'
							>
								Register
							</button>
						</div>
						<Modal />
					</div>
				</div>
			</div>
		</div>
	);
}

export default AuthForm;
